import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Open the cart modal by clicking on the cart icon/text
    // Try multiple selector strategies: text, class, xpath
    let cartSelector = null;
    // Try to find the cart element by text
    const cartText = await page.$('//div[contains(normalize-space(.), "Cart")]');
    if (cartText) {
      cartSelector = '//div[contains(normalize-space(.), "Cart")]';
      await cartText.click();
    } else {
      // Try by class name
      const cartClass = await page.$('.cart');
      if (cartClass) {
        cartSelector = '.cart';
        await cartClass.click();
      } else {
        // Try by alternative text
        throw new Error('Could not find cart element to open cart modal');
      }
    }

    // Wait for the cart modal to appear (look for cartItems container)
    await page.waitForSelector('#cartItems, .cart-item, .empty-cart', { timeout: 5000 });

    // Take screenshot of cart modal open
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_cart_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_cart_open.png'));

    // Check if there is at least one cart item
    let cartItem = await page.$('.cart-item');
    if (!cartItem) {
      // If cart is empty, add a product to cart first
      // Find an "Add to Cart" button on a product card (not in modal)
      const addToCartBtn = await page.$('button.add-to-cart:not([disabled])');
      if (!addToCartBtn) {
        throw new Error('No enabled Add to Cart button found to add an item');
      }
      await addToCartBtn.click();

      // Wait for notification to disappear (if any), then reopen cart
      await page.waitForTimeout(1000);

      // Click cart again to open modal
      if (cartSelector) {
        if (cartSelector.startsWith('//')) {
          await page.click(cartSelector);
        } else {
          await page.click(cartSelector);
        }
      }
      await page.waitForSelector('.cart-item', { timeout: 5000 });
      cartItem = await page.$('.cart-item');
    }

    // Take screenshot after ensuring cart has at least one item
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_cart_with_item.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_cart_with_item.png'));

    // Find the first cart item and its quantity controls
    // Use XPath to get the first cart-item's quantity span and plus button
    const cartItemHandle = await page.$('(//div[contains(@class,"cart-item")])[1]');
    if (!cartItemHandle) {
      throw new Error('No cart item found after adding to cart');
    }

    // Extract current quantity
    const quantitySpan = await cartItemHandle.$('.quantity');
    let oldQuantity = 1;
    if (quantitySpan) {
      oldQuantity = parseInt(await quantitySpan.innerText(), 10);
    }

    // Find the "+" button (increase quantity)
    const plusBtn = await cartItemHandle.$('button.quantity-btn:nth-of-type(2)');
    if (!plusBtn) {
      throw new Error('Could not find "+" button to increase quantity');
    }

    // Click the "+" button to increase quantity by 1
    await plusBtn.click();

    // Wait for quantity to update (wait for the quantity span's text to change)
    await page.waitForFunction(
      (selector, prevQty) => {
        const el = document.querySelector(selector);
        return el && parseInt(el.innerText, 10) === prevQty + 1;
      },
      {},
      '.cart-item .quantity',
      oldQuantity
    );

    // Take screenshot after quantity update
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_quantity_updated.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_quantity_updated.png'));

    // Extract updated cart data for verification
    const updatedCartData = await page.evaluate(() => {
      const item = document.querySelector('.cart-item');
      if (!item) return null;
      const title = item.querySelector('.cart-item-title')?.innerText || '';
      const price = item.querySelector('.cart-item-price')?.innerText || '';
      const quantity = item.querySelector('.quantity')?.innerText || '';
      return { title, price, quantity };
    });

    return {
      success: true,
      action: "Updated cart item quantity by increasing it via the cart modal. Verified quantity change.",
      extractedData: {
        cartItem: updatedCartData
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
